import React, { useState } from "react";
import {
  HomeBody,
  ActionContainer,
  HeaderContainer,
  AboutContainer,
  Footer,
  CustomModal,
  CustomTabs,
  CustomInput,
} from "./styles";
import { LockOutlined, UserOutlined } from "@ant-design/icons";
const { TabPane } = CustomTabs;
import { Form } from "antd";

const Home = () => {
  const [isModalVisible, setModalShow] = useState(false);
  const [activeTab, setActiveTab] = useState("login");

  const showLoginModal = () => {
    setModalShow(true);
    setActiveTab("login");
    console.log("hey");
  };
  const showSignUpModal = () => {
    setModalShow(true);
    setActiveTab("signup");
  };
  const hideModal = () => {
    setModalShow(false);
  };
  const handleAction = () => {
    if (activeTab === "login") {
      handleLogin();
    } else {
      handleSignUp();
    }
  };
